import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css';

const UpdatePerson = () => {
    const { id } = useParams(); // Obtener el ID de la URL
    const navigate = useNavigate();
    
    const [persona, setPersona] = useState({
        primerNombre: '',
        segundoNombre: '',
        primerApellido: '',
        segundoApellido: '',
        identificacion: '',
        email: '',
        fechaNacimiento: '',
        edadClinica: '',
        ubicacion: {
            lugar: '',
            ciudad: '',
            departamento: '',
        },
        usuario: {
            login: '',
            password: '',
            apikey: ''
        }
    });

    useEffect(() => {
        // Cargar la persona al iniciar el componente
        const loadPersona = async () => {
            const token = localStorage.getItem('token'); // Obtener el token de localStorage
            const response = await fetch(`http://localhost:9001/Laboratorio1/persona/id/${id}`, {
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            });
            const data = await response.json();
            setPersona(data);
        };

        loadPersona();
    }, [id]);

    const handleChange = (e) => {
        const { name, value } = e.target;
        setPersona({
            ...persona,
            [name]: value,
        });
    };

    const handleUbicacionChange = (e) => {
        const { name, value } = e.target;
        setPersona({
            ...persona,
            ubicacion: {
                ...persona.ubicacion,
                [name]: value,
            }
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        const token = localStorage.getItem('token'); // Obtener el token de localStorage
        const response = await fetch(`http://localhost:9001/Laboratorio1/persona`, {
            method: 'PUT',
            headers: {
                'Content-Type': 'application/json',
                'Authorization': `Bearer ${token}`
            },
            body: JSON.stringify(persona),
        });

        if (response.ok) {
            Swal.fire('Actualizado', 'Los datos han sido actualizados correctamente.', 'success');
            navigate('/home'); // Redirigir a la p√°gina de inicio
        } else {
            Swal.fire('Error', 'No se pudo actualizar los datos.', 'error');
        }
    };

    return (
        <div className="container mt-5">
            <h2>Actualizar Persona</h2>
            <form onSubmit={handleSubmit}>
                <div className="mb-3">
                    <label className="form-label">Primer Nombre</label>
                    <input type="text" className="form-control" name="primerNombre" value={persona.primerNombre} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Segundo Nombre</label>
                    <input type="text" className="form-control" name="segundoNombre" value={persona.segundoNombre} onChange={handleChange} />
                </div>
                <div className="mb-3">
                    <label className="form-label">Primer Apellido</label>
                    <input type="text" className="form-control" name="primerApellido" value={persona.primerApellido} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Segundo Apellido</label>
                    <input type="text" className="form-control" name="segundoApellido" value={persona.segundoApellido} onChange={handleChange} />
                </div>
                <div className="mb-3">
                    <label className="form-label">Identificaci√≥n</label>
                    <input type="number" className="form-control" name="identificacion" value={persona.identificacion} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Email</label>
                    <input type="email" className="form-control" name="email" value={persona.email} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Fecha de Nacimiento</label>
                    <input type="date" className="form-control" name="fechaNacimiento" value={persona.fechaNacimiento} onChange={handleChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Lugar</label>
                    <input type="text" className="form-control" name="lugar" value={persona.ubicacion.lugar} onChange={handleUbicacionChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Ciudad</label>
                    <input type="text" className="form-control" name="ciudad" value={persona.ubicacion.ciudad} onChange={handleUbicacionChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Departamento</label>
                    <input type="text" className="form-control" name="departamento" value={persona.ubicacion.departamento} onChange={handleUbicacionChange} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Usuario (Login)</label>
                    <input type="text" className="form-control" name="login" value={persona.usuario.login} onChange={(e) => setPersona({ ...persona, usuario: { ...persona.usuario, login: e.target.value } })} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">Contrase√±a</label>
                    <input type="password" className="form-control" name="password" value={persona.usuario.password} onChange={(e) => setPersona({ ...persona, usuario: { ...persona.usuario, password: e.target.value } })} required />
                </div>
                <div className="mb-3">
                    <label className="form-label">API Key</label>
                    <input type="text" className="form-control" name="apikey" value={persona.usuario.apikey} onChange={(e) => setPersona({ ...persona, usuario: { ...persona.usuario, apikey: e.target.value } })} required />
                </div>
                <button type="submit" className="btn btn-primary">Actualizar</button>
            </form>
        </div>
    );
};

export default UpdatePerson;
